import React from 'react'
import { MenuItem, NavItem, Navbar, Nav, NavDropdown } from 'react-bootstrap';
import SignupComponent from './SignupComponent';

class HeaderComponent extends React.Component {
    
    constructor(props)
    {
        super(props);

        this.state = {
            signup : false
        }
    }

        test = () => {
            this.props.signup = true;
        }
    render() {
        var overlay = this.props.signup ? <SignupComponent /> : null;
        return (
            <div>
            <Navbar inverse collapseOnSelect>
  <Navbar.Header>
    <Navbar.Brand>
      <a href="#brand">Fruit Trader</a>
    </Navbar.Brand>
    <Navbar.Toggle />
  </Navbar.Header>
  <Navbar.Collapse>
    <Nav pullRight>
      <NavItem onClick={this.test} eventKey={1} href="#">
        Sign Up
      </NavItem>
      <NavItem eventKey={2} href="#">
        Log In
      </NavItem>
    </Nav>
  </Navbar.Collapse>
</Navbar>
{ overlay }
</div>
        );  
    }
  }

  export default HeaderComponent;
